import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { useForm } from "react-hook-form";

function Nemovitosti() {
  const [nemovitosti, setNemovitosti] = useState([]);
  const [isFormOpen, setIsFormOpen] = useState(false);
  const [editingNemovitost, setEditingNemovitost] = useState(null);
  const { register, handleSubmit, reset, setValue } = useForm();

  useEffect(() => {
    fetch("http://localhost:3001/api/nemovitosti")
      .then((response) => response.json())
      .then((data) => setNemovitosti(data))
      .catch((error) =>
        console.error("Chyba při načítání nemovitostí:", error)
      );
  }, []);

  const onSubmit = async (data) => {
    try {
      const url = editingNemovitost
        ? `http://localhost:3001/api/nemovitosti/${editingNemovitost._id}`
        : "http://localhost:3001/api/nemovitosti";
      const method = editingNemovitost ? "PUT" : "POST";

      const response = await fetch(url, {
        method,
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(data),
      });

      if (response.ok) {
        const updatedNemovitost = await response.json();
        if (editingNemovitost) {
          setNemovitosti(
            nemovitosti.map((n) =>
              n._id === editingNemovitost._id ? { ...n, ...data } : n
            )
          );
        } else {
          setNemovitosti([...nemovitosti, updatedNemovitost]);
        }
        setIsFormOpen(false);
        setEditingNemovitost(null);
        reset();
      }
    } catch (error) {
      console.error("Chyba při ukládání nemovitosti:", error);
    }
  };

  const handleEdit = (nemovitost) => {
    setEditingNemovitost(nemovitost);
    setIsFormOpen(true);
    setValue("adresa", nemovitost.adresa);
    setValue("typ", nemovitost.typ);
    setValue("cena", nemovitost.cena);
    setValue("popis", nemovitost.popis);
    setValue("prodano", nemovitost.prodano);
    setValue(
      "datumProdeje",
      nemovitost.datumProdeje
        ? new Date(nemovitost.datumProdeje).toISOString().slice(0, 10)
        : ""
    );
  };

  const handleDelete = async (id) => {
    try {
      const response = await fetch(
        `http://localhost:3001/api/nemovitosti/${id}`,
        {
          method: "DELETE",
        }
      );
      if (response.ok) {
        setNemovitosti(nemovitosti.filter((n) => n._id !== id));
      }
    } catch (error) {
      console.error("Chyba při mazání nemovitosti:", error);
    }
  };

  return (
    <div className="container">
      <header
        style={{ display: "flex", alignItems: "center", marginBottom: "2rem" }}
      >
        <Link
          to="/dashboard"
          style={{
            display: "flex",
            alignItems: "center",
            textDecoration: "none",
            color: "inherit",
          }}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            stroke="#2563eb"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            style={{ marginRight: "0.5rem" }}
          >
            <path d="M3 9l9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"></path>
            <polyline points="9 22 9 12 15 12 15 22"></polyline>
          </svg>
          <h1 style={{ fontSize: "1.5rem", margin: 0 }}>ProperTea</h1>
        </Link>
      </header>

      <h2>Seznam nemovitostí</h2>
      <button
        onClick={() => {
          setEditingNemovitost(null);
          setIsFormOpen(true);
          reset();
        }}
        style={{
          backgroundColor: "#2563eb",
          color: "white",
          padding: "0.5rem 1rem",
          border: "none",
          borderRadius: "4px",
          cursor: "pointer",
          marginBottom: "1rem",
        }}
      >
        Přidat novou nemovitost
      </button>

      <ul style={{ listStyle: "none", padding: 0 }}>
        {nemovitosti.length === 0 ? (
          <li>Žádné nemovitosti</li>
        ) : (
          nemovitosti.map((nemovitost) => (
            <li
              key={nemovitost._id}
              style={{
                padding: "0.5rem",
                border: "1px solid #ccc",
                marginBottom: "0.5rem",
                borderRadius: "4px",
                display: "flex",
                justifyContent: "space-between",
                alignItems: "center",
              }}
            >
              <Link
                to={`/nemovitosti/${nemovitost._id}/prohlidky`}
                style={{ textDecoration: "none", color: "inherit" }}
              >
                {nemovitost.adresa} ({nemovitost.typ},{" "}
                {nemovitost.cena.toLocaleString("cs-CZ")} Kč)
              </Link>
              <div>
                <button
                  onClick={() => handleEdit(nemovitost)}
                  style={{
                    backgroundColor: "#10b981",
                    color: "white",
                    padding: "0.3rem 0.8rem",
                    border: "none",
                    borderRadius: "4px",
                    cursor: "pointer",
                    marginLeft: "0.5rem",
                  }}
                >
                  Editovat
                </button>
                <button
                  onClick={() => handleDelete(nemovitost._id)}
                  style={{
                    backgroundColor: "#dc2626",
                    color: "white",
                    padding: "0.3rem 0.8rem",
                    border: "none",
                    borderRadius: "4px",
                    cursor: "pointer",
                    marginLeft: "0.5rem",
                  }}
                >
                  Smazat
                </button>
              </div>
            </li>
          ))
        )}
      </ul>

      {isFormOpen && (
        <div
          style={{
            position: "fixed",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            backgroundColor: "white",
            padding: "2rem",
            border: "1px solid #ccc",
            borderRadius: "8px",
            boxShadow: "0 4px 8px rgba(0,0,0,0.2)",
            zIndex: 1000,
          }}
        >
          <h2>
            {editingNemovitost ? "Editovat nemovitost" : "Přidat nemovitost"}
          </h2>
          <form
            onSubmit={handleSubmit(onSubmit)}
            style={{ display: "flex", flexDirection: "column", gap: "1rem" }}
          >
            <label>
              Adresa:
              <input
                {...register("adresa", { required: true })}
                style={{ padding: "0.5rem", border: "1px solid #ccc" }}
              />
            </label>
            <label>
              Typ:
              <select
                {...register("typ", { required: true })}
                style={{ padding: "0.5rem", border: "1px solid #ccc" }}
              >
                <option value="Byt">Byt</option>
                <option value="Dům">Dům</option>
                <option value="Pozemek">Pozemek</option>
              </select>
            </label>
            <label>
              Cena:
              <input
                type="number"
                {...register("cena", { required: true })}
                style={{ padding: "0.5rem", border: "1px solid #ccc" }}
              />
            </label>
            <label>
              Popis:
              <textarea
                {...register("popis")}
                style={{ padding: "0.5rem", border: "1px solid #ccc" }}
              />
            </label>
            <label>
              Prodáno:
              <input type="checkbox" {...register("prodano")} />
            </label>
            <label>
              Datum prodeje:
              <input
                type="date"
                {...register("datumProdeje")}
                style={{ padding: "0.5rem", border: "1px solid #ccc" }}
              />
            </label>
            <div style={{ display: "flex", gap: "1rem" }}>
              <button
                type="submit"
                style={{
                  backgroundColor: "#2563eb",
                  color: "white",
                  padding: "0.5rem 1rem",
                  border: "none",
                  borderRadius: "4px",
                  cursor: "pointer",
                }}
              >
                {editingNemovitost ? "Uložit změny" : "Vytvořit"}
              </button>
              <button
                type="button"
                onClick={() => {
                  setIsFormOpen(false);
                  setEditingNemovitost(null);
                  reset();
                }}
                style={{
                  backgroundColor: "#6b7280",
                  color: "white",
                  padding: "0.5rem 1rem",
                  border: "none",
                  borderRadius: "4px",
                  cursor: "pointer",
                }}
              >
                Zrušit
              </button>
            </div>
          </form>
        </div>
      )}
    </div>
  );
}

export default Nemovitosti;
